const config = {
  youtube: {
    apiKey: process.env.local.REACT_APP_YOUTUBE_API_KEY,
    channelId: process.env.local.REACT_APP_YOUTUBE_CHANNEL_ID,
    baseUrl: 'https://www.googleapis.com/youtube/v3'
  }
};

// Validação de segurança
if (!config.youtube.apiKey) {
  console.warn('YouTube API Key não encontrada. Usando modo fallback.');
}

export default config;
